import React from 'react';
import Styles from './LoginFormY.module.css'
import { Link } from 'react-router-dom/cjs/react-router-dom';
import { useFormik } from 'formik';
import { simpleFormSchema } from '../schemas';
// import Navbar from '../Pages/Navbar';

const initialValues = {
  username: '',
  password: '',
  confirm_password: ''
}


const LoginFormY = () => {
  const { values, errors, handleBlur, touched, handleChange, handleSubmit } = useFormik({
    initialValues: initialValues,
    validationSchema: simpleFormSchema,
    onSubmit: (value, action) => {
      console.log(value);
      action.resetForm()

    }

  })
  return (
    <>
    {/* <div className="ms-5">

    <Navbar/>
    </div> */}
      <section className={Styles.Form_second_main_section}>
        <div className={Styles.color}></div>
        <div className={Styles.color}></div>
        <div className={Styles.color}></div>
        <div className={Styles.circles}>
          <div className={Styles.circle}></div>
          <div className={Styles.circle}></div>
          <div className={Styles.circle}></div>
        </div>
        <div className={Styles.box}>
          <div className={Styles.square}></div>
          <div className={Styles.square}></div>
          <div className={Styles.square}></div>
          <div className={Styles.square}></div>
          <div className={Styles.square}></div>
          <div className={Styles.Form_second_container}>
            <div className={Styles.form_second}>
              <h2>Login Form</h2>
              <form onSubmit={handleSubmit}>
                <div className={Styles.Form_second_inputBox}>
                  <input type="text" autoComplete='off' placeholder="Username" value={values.username} onChange={handleChange} onBlur={handleBlur} minLength="4" maxLength="20" id={Styles.username} name="username" />
                  {errors.username && touched.username ? (<p>{errors.username}</p>) : null}
                </div>
                <div className={Styles.Form_second_inputBox}>
                  <input type="password" autoComplete='off' placeholder="Password" value={values.password} onChange={handleChange} onBlur={handleBlur} minLength="6" maxLength="50" id={Styles.password} name="password" />
                  {errors.password && touched.password ? (<p>{errors.password}</p>) : null}
                </div>
                {/* <div className={Styles.Form_second_inputBox}>
                                    <input type="password" autoComplete='off' placeholder="confirm_password" value={values.confirm_password} onChange={handleChange} onBlur={handleBlur} minLength="6" maxLength="50" id="confirm_password" name="confirm_password" />
                                    {errors.confirm_password && touched.confirm_password ? (<p>{errors.confirm_password}</p>) : null}
                                </div> */}
                <div className={Styles.Form_second_inputBox}>
                  <input type="submit" value="Login" />
                </div>
                <p className={Styles.Form_second_forget}>Forgot password ? <Link to="#">Click Here</Link></p>
                <p className={Styles.Form_second_forget}>Don't have an account ? <Link to="#">Sign up</Link></p>
              </form>
            </div>
          </div>
        </div>
      </section>
    </>
  );
}

export default LoginFormY;
